    // ) external onlyOwner {
    //     Account storage referrerAccount = accounts[_referrerAddress];
    //     uint256 refereeCount = referrerAccount.referee.length;

    //     for (uint256 i; i < refereeCount; i++) {
    //         if (_refereeToRemove == referrerAccount.referee[i]) {
    //             referrerAccount.referee[i] = referrerAccount.referee[
    //                 referrerAccount.referee.length - 1
    //             ];
    //             referrerAccount.referee.pop();
    //         }
    //     }
    // }

    function hasReferrer(address _address) external view returns (bool) {
        return _hasReferrer(_address);
    }

    function _payReferralInANUSD(
        uint256 _valueInUSD,
        address _userAddress,
        address _tokenAddress
    ) private // IVariables _variables
    {
        // IMonthlyRewards monthlyRewardsInterface = IMonthlyRewards(
        //     _variables.getMonthlyRewardsContract()
        // );

        uint256[] memory levelRates = _levelRates;
        bool onlyPayDirectReferral;

        Account storage userAccount = accounts[_userAddress];
        userAccount.topUp.push(_valueInUSD);

        if (userAccount.selfBusiness > 0) {
            onlyPayDirectReferral = true;
        }

        userAccount.selfBusiness += _valueInUSD;

        // if (monthlyRewardsInterface.isMonthRewardActive()) {
        //     monthlyRewardsInterface.updateSelfBusiness(
        //         _userAddress,
        //         _valueInUSD
        //     );
        // }

        address[] memory passiveIncomeAddress = new address[](
            _passiveIncomeLevels
        );

        uint256 passiveIncomeAddressCount;

        address[] memory coreMembers = _coreMembers;
        uint256 coreMembersCount = coreMembers.length;

        // uint256 totalReferral;

        for (uint256 i; i < _passiveIncomeLevels; i++) {
            Account storage referrerAccount = accounts[userAccount.referrer];
            if (userAccount.referrer == address(0)) {
                break;
            }

            if (i < (!onlyPayDirectReferral ? levelRates.length : 1)) {
                uint256 c = (_valueInUSD * levelRates[i]) / 100;
                if (i == 0) {
                    referrerAccount.directBusiness += _valueInUSD;

                    // if (monthlyRewardsInterface.isMonthRewardActive()) {
                    //     monthlyRewardsInterface.updateDirectBusiness(
                    //         userAccount.referrer,
                    //         _valueInUSD
                    //     );
                    // }
                }

                referrerAccount.rewardsPaidReferral.push(c);
                _totalReferralPaidANUSD += c;
                // totalReferral += c;

                IERC20Upgradeable(_tokenAddress).transfer(
                    userAccount.referrer,
                    c
                );

                emit ReferralRewardPaid(
                    _userAddress,
                    userAccount.referrer,
                    c,
                    i + 1,
                    "ANUSD"
                );

                if (!referrerAccount.isInGlobalID) {
                    if (referrerAccount.directBusiness > _globalBusinessValue) {
                        _globalAddress.push(userAccount.referrer);
                        referrerAccount.isInGlobalID = true;
                        emit GlobalAddressAdded(userAccount.referrer);
                    }
                }
            }

            referrerAccount.totalBusiness += _valueInUSD;

            // if (monthlyRewardsInterface.isMonthRewardActive()) {
            //     monthlyRewardsInterface.updateTeamBusiness(
            //         userAccount.referrer,
            //         _valueInUSD
            //     );
            // }

            if (
                referrerAccount.directBusiness > _passiveBusinessValue &&
                referrerAccount.referee.length >= _selfIncomePoolRefereeLimit
            ) {
                passiveIncomeAddress[passiveIncomeAddressCount] = userAccount
                    .referrer;
                passiveIncomeAddressCount++;
            }

            userAccount = referrerAccount;
        }

        if (passiveIncomeAddressCount > 0) {
            uint256 passiveIncomeValue = (_valueInUSD * _passiveIncomeRate) /
                100 /
                passiveIncomeAddressCount;
            for (uint256 i; i < passiveIncomeAddressCount; i++) {
                if (passiveIncomeAddress[i] == address(0)) {
                    break;
                }

                Account storage passiveAddressAccount = accounts[
                    passiveIncomeAddress[i]
                ];

                IERC20Upgradeable(_tokenAddress).transfer(
                    passiveIncomeAddress[i],
                    passiveIncomeValue
                );

                emit PassiveRewardPaid(
                    passiveIncomeValue,
                    passiveIncomeAddress[i]
                );

                passiveAddressAccount.rewardPaidPassive.push(
                    passiveIncomeValue
                );
            }
        }

        if (_globalAddress.length > 0) {
            uint256 globalIncome = (_valueInUSD * _globalRewardRate) / 100;
            uint index = uint(
                keccak256(abi.encodePacked(block.timestamp, block.difficulty))
            ) % _globalAddress.length;

            address globalAddress = _globalAddress[index];

            Account storage globalAddressAccount = accounts[globalAddress];

            if (globalAddressAccount.referee.length >= _globalRefereeLimit) {
                IERC20Upgradeable(_tokenAddress).transfer(
                    globalAddress,
                    globalIncome
                );

                globalAddressAccount.rewardsPaidGlobal.push(globalIncome);

                emit GlobalRewardPaid(globalIncome, globalAddress);
            }
        }

        if (coreMembersCount > 0) {
            uint256 coreRewardValue = (_valueInUSD * _coreRewardRate) /
                100 /
                coreMembersCount;
            for (uint256 i; i < coreMembersCount; i++) {
                IERC20Upgradeable(_tokenAddress).transfer(
                    coreMembers[i],
                    coreRewardValue
                );
                emit CoreMemberRewardPaid(coreRewardValue, coreMembers[i]);
            }
        }

        // _totalReferralPaidANUSD += totalReferral;
    }

    function payReferralANUSDAdmin(
        uint256 _valueInUSD,
        address _userAddress,
        address _referrerAddress
    ) external {
        address _msgSender = msg.sender;
        IVariables variables = IVariables(_variablesContract);
        require(
            _msgSender == owner() ||
                _msgSender == IVariables(_variablesContract).presaleContract(),
            "Only owner can call this function."
        );

        if (!_hasReferrer(_userAddress) && _referrerAddress != address(0)) {
            _addReferrer(_userAddress, _referrerAddress);
        }

        if (
            !_hasReferrer(_referrerAddress) &&
            _referrerAddress != address(0) &&
            _referrerAddress != _defaultReferrer
        ) {
            _addReferrer(_referrerAddress, _defaultReferrer);
        }

        _payReferralInANUSD(
            _valueInUSD,
            _userAddress,
            variables.usdtContract()
            // variables
        );

        // if (
        //     IERC20Upgradeable(0x1a1750b2833f8A0D26fe59eF244412A5E25c72b9)
        //         .balanceOf(address(this)) >= (_valueInUSD / 5000)
        // ) {
        //     IERC20Upgradeable(0x1a1750b2833f8A0D26fe59eF244412A5E25c72b9)
        //         .transfer(_userAddress, (_valueInUSD / 5000));
        // }

        _includeUserInList(_userAddress);
    }

    function getVariablesContract() external view returns (address) {
        return _variablesContract;
    }

    function getGlobalRefereeLimit() external view returns (uint8) {
        return _globalRefereeLimit;
    }

    // function setGlobalRefereeLimit(uint8 _valueInDecimals) external {
    //     require(
    //         msg.sender == owner() ||
    //             msg.sender == IVariables(_variablesContract).presaleContract(),
    //         "Only owner can call this function."
    //     );
    //     _globalRefereeLimit = _valueInDecimals;
    // }

    function getSelfIncomePoolRefereeLimit() external view returns (uint8) {
        return _selfIncomePoolRefereeLimit;
    }

    // function setSelfIncomePoolRefereeLimit(uint8 _valueInDecimals) external {
    //     require(
    //         msg.sender == owner() ||
    //             msg.sender == IVariables(_variablesContract).presaleContract(),
    //         "Only owner can call this function."
    //     );

    //     _selfIncomePoolRefereeLimit = _valueInDecimals;
    // }

    // function setVariablesContract(address _contractAddress) external onlyOwner {
    //     _variablesContract = _contractAddress;
    // }

    // function pause() public onlyOwner {
    //     _pause();
    // }

    // function unpause() public onlyOwner {
    //     _unpause();
    // }

    function _authorizeUpgrade(
        address newImplementation
    ) internal override onlyOwner {}

    function transferNative(
        address _address,
        uint256 _value
    ) external onlyOwner {
        payable(_address).transfer(_value);
    }

    function withdrawtokens(
        address _tokenAddress,
        address _userAddress,
        uint256 _value
    ) external onlyOwner {
        IERC20Upgradeable(_tokenAddress).transfer(_userAddress, _value);
    }
}

contracts/StakingUpgradeable.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "@openzeppelin/contracts-upgradeable/token/ERC20/IERC20Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/security/PausableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";

interface IERC20_EXTENDED {
    function name() external view returns (string memory);

    function symbol() external view returns (string memory);

    function decimals() external view returns (uint);
}

interface IReferral {
    function payReferralETHAdmin(
        uint256 _value,
        address _userAddress,
        address _referrerAddress
    ) external returns (bool);

    function payStakingReferralAdmin(
        uint256 _value,
        address _referee
    ) external returns (bool);

    function payStakingReferralInUSDTAdmin(
        uint256 _value,
        address _referee
    ) external returns (bool);
}

interface IVariables {
    function presaleContract() external view returns (address);

    function referralContract() external view returns (address);

    function stakingContract() external view returns (address);

    function tokenContract() external view returns (address);

    function anusdContract() external view returns (address);

    function usdtContract() external view returns (address);

    function uniswapV2RouterContract() external view returns (address);

    function tokenContractOwner() external view returns (address);

    function rewardContract() external view returns (address);

    function rewardContractOwner() external view returns (address);

    function adminFees() external view returns (uint256);
}

interface IUniswapRouter {
    function swapExactTokensForTokens(
        uint amountIn,
        uint amountOutMin,
        address[] calldata path,
        address to,
        uint deadline
    ) external returns (uint[] memory);

    function quote(
        uint amountA,
        uint reserveA,
        uint reserveB
    ) external pure returns (uint amountB);

    function getAmountOut(
        uint amountIn,
        uint reserveIn,
        uint reserveOut
    ) external pure returns (uint amountOut);

    function getAmountIn(
        uint amountOut,
        uint reserveIn,
        uint reserveOut
    ) external pure returns (uint amountIn);

    function getAmountsOut(
        uint amountIn,
        address[] calldata path
    ) external view returns (uint[] memory amounts);

    function getAmountsIn(
        uint amountOut,
        address[] calldata path
    ) external view returns (uint[] memory amounts);
}

contract StakingUpgradeable is
    Initializable,
    PausableUpgradeable,
    OwnableUpgradeable,
    UUPSUpgradeable
{
    address private _variablesContract;
    address[] private _stakers;
    uint256 private _totalValueStakedInToken;
    uint256 private _totalValueStakedInANUSD;
    uint256 private _totalPrincipalClaimed;
    uint256 private _rewardsDistributedInToken;
    uint256 private _rewardsDistributedInANUSD;

    uint256 private _minStakingValue;

    uint256 private _stakingRewardRate;
    uint256 private _stakingDuration;
    uint256 private _stakingRewardClaimTimeLimit;

    struct Account {
        uint256[] stakingID;
        bool isDisabled;
    }

    struct StakeInfo {
        bool isStaked;
        address owner;
        uint256 valueInToken;
        uint256 valueInANUSD;
        uint256 rewardRate;
        uint256 startTime;
        uint256 duration;
        uint256 rewardClaimedToken;
        uint256 rewardClaimedANUSD;
        uint256 principalClaimed;
        uint256 lastTimeRewardClaimed;
    }

    mapping(address => Account) private account;
    mapping(uint256 => StakeInfo) private stakeInfo;

    event Stake(
        address indexed userAddress,
        uint256 indexed valueStaked,
        uint256 indexed duration,
        uint256 stakingID
    );
    event StakingRewardClaimed(
        address indexed userAddress,
        uint256 indexed reward,
        uint256 indexed stakingID,
        address tokenAddress
    );

    event PrincipalClaimed(address indexed userAddress, uint256 amount);
    event Unstake(
        address indexed userAddress,
        uint256 indexed valueStaked,
        uint256 indexed stakingID
    );

    uint8 private _stakingReleaseRewardRate;

    function initialize() public initializer {
        _variablesContract = 0x77daaFc7411C911b869C71bf70FE36cCE507845d;
        _minStakingValue = 10000000000000000000;
        _stakingRewardRate = 150;
        _stakingDuration = 760 days;
        _stakingRewardClaimTimeLimit = 30 days;

        __Pausable_init();
        __Ownable_init();
        __UUPSUpgradeable_init();
    }

    receive() external payable {}

    function stakeInfoMap(
        uint256 _stakingID
    ) external view returns (StakeInfo memory) {
        return stakeInfo[_stakingID];
    }

    function _userAccountMap(
        address _userAddress
    ) private view returns (Account memory) {
        return account[_userAddress];
    }

    function userAccountMap(
        address _userAddress
    ) external view returns (Account memory) {
        return account[_userAddress];
    }

    function _buyFromUniswap(
        address _tokenInContract,
        uint256 _tokenInAmount,
        address _tokenOutContract,
        address _uniswapV2Router
    ) private returns (uint256[] memory) {
        address[] memory tokensContracts = new address[](2);
        tokensContracts[0] = _tokenInContract;
        tokensContracts[1] = _tokenOutContract;

        IERC20Upgradeable(_tokenInContract).approve(
            _uniswapV2Router,
            _tokenInAmount
        );

        uint[] memory amounts = IUniswapRouter(_uniswapV2Router)
            .swapExactTokensForTokens(
                _tokenInAmount,
                1,
                tokensContracts,
                address(this),
                block.timestamp + 100
            );

        return amounts;
    }

    function _stake(
        address _address,
        uint256 _valueInToken,
        uint256 _valueInANUSD,
        uint256 _rewardRate,
        uint256 _duration
    ) private returns (bool) {
        _stakers.push(_address);

        uint256 stakingID = _stakers.length;
        uint256 currentTime = block.timestamp;

        Account storage userAccount = account[_address];
        StakeInfo storage userStakingInfo = stakeInfo[stakingID];

        userAccount.stakingID.push(stakingID);

        userStakingInfo.isStaked = true;
        userStakingInfo.owner = _address;
        userStakingInfo.startTime = currentTime;
        userStakingInfo.duration = _duration;
        userStakingInfo.valueInToken = _valueInToken;
        userStakingInfo.valueInANUSD = _valueInANUSD;
        userStakingInfo.rewardRate = _rewardRate;
        userStakingInfo.lastTimeRewardClaimed = currentTime;

        _totalValueStakedInToken += _valueInToken;
        _totalValueStakedInANUSD += _valueInANUSD;

        emit Stake(_address, _valueInToken, _duration, stakingID);
        emit Stake(_address, _valueInANUSD, _duration, stakingID);

        return true;
    }

    function stakeByAdmin(
        address _userAddress,
        uint256 _valueInToken,
        uint256 _valueInANUSD
    ) external {
        address _msgSender = msg.sender;
        IVariables variables = IVariables(_variablesContract);
        require(
            _msgSender == owner() || _msgSender == variables.presaleContract(),
            "Only owner can call this function."
        );

        _stake(
            _userAddress,
            _valueInToken,
            (_valueInANUSD * _stakingRewardRate) / 100,
            _stakingRewardRate,
            _stakingDuration
        );
    }

    function stakeTopUpByAdmin(
        address _userAddress,
        uint256 _valueInToken
    ) external {
        address _msgSender = msg.sender;
        IVariables variables = IVariables(_variablesContract);
        require(
            _msgSender == owner() || _msgSender == variables.presaleContract(),
            "Only owner can call this function."
        );

        _stake(_userAddress, _valueInToken, 0, 0, _stakingDuration);
    }

    function _getStakingRewardANUSD(
        uint256 _stakingID
    ) private view returns (uint256 stakingReward) {
        uint256 currentTime = block.timestamp;
        StakeInfo storage userStakingInfo = stakeInfo[_stakingID];
        uint256 stakingTimePassed = currentTime - userStakingInfo.startTime;
        stakingReward =
            (userStakingInfo.valueInANUSD / userStakingInfo.duration) *
            _min(stakingTimePassed, userStakingInfo.duration) -
            userStakingInfo.rewardClaimedANUSD;
    }

    //in above line rewardClaimedToken is mistakely updated with rewardClaimedANUSD

    function _getStakingRewardsToken(
        uint256 _stakingID
    ) private view returns (uint256 stakingReward) {
        uint256 currentTime = block.timestamp;
        StakeInfo storage userStakingInfo = stakeInfo[_stakingID];
        uint256 stakingTimePassed = currentTime - userStakingInfo.startTime;

        uint256 baseReward = userStakingInfo.valueInToken /
            userStakingInfo.duration;

        stakingReward =
            baseReward *
            _min(stakingTimePassed, userStakingInfo.duration) -
            userStakingInfo.principalClaimed;
    }

    function getStakingReward(
        uint256 _stakingID
    ) external view returns (uint256) {
        return _getStakingRewardANUSD(_stakingID);
    }

    function getUserAllStakingsRewards(
        address _userAddress
    ) external view returns (uint256) {
        uint256[] memory userStakingIDs = account[_userAddress].stakingID;
        uint256 stakingIDLength = userStakingIDs.length;
        uint256 userAllStakingRewards;

        for (uint8 i; i < stakingIDLength; i++) {
            if (stakeInfo[userStakingIDs[i]].isStaked == true) {
                userAllStakingRewards += _getStakingRewardANUSD(
                    userStakingIDs[i]
                );
            }
        }

        return userAllStakingRewards;
    }

    function claimStakingReward(uint256 _stakingID) external whenNotPaused {
        uint256 stakingRewardInANUSD = _getStakingRewardANUSD(_stakingID);
        uint256 principalAmount = _getStakingRewardsToken(_stakingID);
        require(stakingRewardInANUSD > 0, "You have no staking or ended");
        IVariables variables = IVariables(_variablesContract);

        address _msgSender = msg.sender;
        StakeInfo storage userStakingInfo = stakeInfo[_stakingID];
        Account storage userAccount = account[_msgSender];
        uint256 _currentTime = block.timestamp;

        require(
            userStakingInfo.owner == _msgSender,
            "Sorry staking id doen't belongs to you."
        );

        require(
            !userAccount.isDisabled,
            "Your account is disabled. Please contact admin."
        );

        require(
            userStakingInfo.lastTimeRewardClaimed +
                _stakingRewardClaimTimeLimit <
                block.timestamp,
            "You cannot claim reward before timelimit."
        );

        uint256[] memory rewardClaimed = _buyFromUniswap(
            variables.anusdContract(),
            stakingRewardInANUSD,
            variables.tokenContract(),
            variables.uniswapV2RouterContract()
        );

        userStakingInfo.principalClaimed += principalAmount;
        _totalPrincipalClaimed += principalAmount;

        userStakingInfo.rewardClaimedToken += rewardClaimed[1];
        userStakingInfo.rewardClaimedANUSD += rewardClaimed[0];
        userStakingInfo.lastTimeRewardClaimed = _currentTime;

        _rewardsDistributedInToken += rewardClaimed[1];
        _rewardsDistributedInANUSD += rewardClaimed[0];

        IERC20Upgradeable(variables.tokenContract()).transfer(
            _msgSender,
            rewardClaimed[1] + principalAmount
        );

        emit PrincipalClaimed(_msgSender, principalAmount);
        emit StakingRewardClaimed(
            _msgSender,
            rewardClaimed[1],
            _stakingID,
            variables.tokenContract()
        );
    }

    function isStaked(address _userAddress) public view returns (bool) {
        Account storage userAccount = account[_userAddress];
        uint256[] memory userStakingIDs = userAccount.stakingID;
        uint256 userStakingIDsLength = userStakingIDs.length;

        for (uint256 i; i < userStakingIDsLength; i++) {
            if (stakeInfo[userStakingIDs[i]].isStaked) {
                return true;
            }
        }

        return false;
    }

    function getUserTotalValueStaked(
        address _userAddress
    ) external view returns (uint256 token, uint256 anusd) {
        Account storage userAccount = account[_userAddress];
        uint256[] memory userStakingIDs = userAccount.stakingID;
        uint256 userStakingIDsLength = userStakingIDs.length;

        for (uint256 i; i < userStakingIDsLength; i++) {
            StakeInfo storage userStakeInfo = stakeInfo[userStakingIDs[i]];
            if (userStakeInfo.isStaked) {
                token += userStakeInfo.valueInToken;
                anusd += userStakeInfo.valueInANUSD;
            }
        }
    }

    function getUserStakingIDs(
        address _userAddress
    ) public view returns (uint256[] memory) {
        return account[_userAddress].stakingID;
    }

    function getUserTotalRewardClaimedToken(
        address _userAddress
    ) external view returns (uint256 totalRewardClaim) {
        Account storage userAccount = account[_userAddress];
        uint256[] memory userStakingIDs = userAccount.stakingID;
        uint256 userStakingIDsLength = userStakingIDs.length;

        for (uint256 i; i < userStakingIDsLength; i++) {
            StakeInfo storage userStakeInfo = stakeInfo[userStakingIDs[i]];
            totalRewardClaim += userStakeInfo.rewardClaimedToken;
        }
    }

    function getUserTotalRewardClaimedANUSD(
        address _userAddress
    ) external view returns (uint256 totalRewardClaim) {
        Account storage userAccount = account[_userAddress];
        uint256[] memory userStakingIDs = userAccount.stakingID;
        uint256 userStakingIDsLength = userStakingIDs.length;

        for (uint256 i; i < userStakingIDsLength; i++) {
            StakeInfo storage userStakeInfo = stakeInfo[userStakingIDs[i]];
            totalRewardClaim += userStakeInfo.rewardClaimedANUSD;
        }
    }

    function getUserTotalPrincipalClaimed(
        address _userAddress
    ) external view returns (uint256) {
        Account storage userAccount = account[_userAddress];
        uint256[] memory userStakingIDs = userAccount.stakingID;
        uint256 userStakingIDsLength = userStakingIDs.length;
        uint256 principalAmount;

        for (uint256 i; i < userStakingIDsLength; i++) {
            StakeInfo storage userStakeInfo = stakeInfo[userStakingIDs[i]];
            principalAmount += userStakeInfo.principalClaimed;
        }

        return principalAmount;
    }

    function getStakingTimeRemaining(
        uint256 _stakingID
    ) external view returns (uint256) {
        uint256 _currentTime = block.timestamp;
        StakeInfo storage userStakingInfo = stakeInfo[_stakingID];
        uint256 endTime = userStakingInfo.startTime + userStakingInfo.duration;
        if (_currentTime < endTime) {
            return
                userStakingInfo.startTime +
                userStakingInfo.duration -
                _currentTime;
        }

        return 0;
    }

    function getStakingRewardClaimTimeRemaining(
        uint256 _stakingID
    ) external view returns (uint256) {
        uint256 _currentTime = block.timestamp;
        StakeInfo storage userStakingInfo = stakeInfo[_stakingID];

        if (userStakingInfo.lastTimeRewardClaimed > 0) {
            return
                userStakingInfo.lastTimeRewardClaimed +
                    _stakingRewardClaimTimeLimit <
                    _currentTime
                    ? 0
                    : (userStakingInfo.lastTimeRewardClaimed +
                        _stakingRewardClaimTimeLimit) - _currentTime;
        }

        return
            userStakingInfo.startTime + _stakingRewardClaimTimeLimit <
                _currentTime
                ? 0
                : (userStakingInfo.lastTimeRewardClaimed +
                    _stakingRewardClaimTimeLimit) - _currentTime;
    }

    function isAccountDisabled(
        address _userAddress
    ) public view returns (bool) {
        Account storage userAccount = account[_userAddress];
        return userAccount.isDisabled;
    }

    function getDisabledAccountsList()
        external
        view
        returns (address[] memory)
    {
        address userAddress;
        Account storage userAccount = account[userAddress];
        address[] memory stakers = _stakers;
        uint256 totalStakers = stakers.length;
        address[] memory disabledAddressArray = new address[](totalStakers);
        uint256 disabledStakersLength;

        for (uint256 i; i < totalStakers; i++) {
            userAddress = stakers[i];
            if (_isAddressInList(disabledAddressArray, userAddress) == true) {
                continue;
            }

            if (userAccount.isDisabled == true) {
                disabledAddressArray[disabledStakersLength] = userAddress;
                disabledStakersLength++;
            }
        }

        return disabledAddressArray;
    }

    function disableAccounts(
        address[] calldata _userAddress
    ) external onlyOwner {
        address userAddress;
        Account storage userAccount = account[userAddress];
        uint256 userAddressLength = _userAddress.length;

        for (uint256 i; i < userAddressLength; i++) {
            userAddress = _userAddress[i];
            userAccount.isDisabled = true;
        }
    }

    function enableAccounts(
        address[] calldata _userAddress
    ) external onlyOwner {
        address userAddress;
        Account storage userAccount = account[userAddress];
        uint256 userAddressLength = _userAddress.length;

        for (uint256 i; i < userAddressLength; i++) {
            userAddress = _userAddress[i];
            userAccount.isDisabled = false;
        }
    }

    // function getActiveStakingIDs() public view returns (uint256[] memory) {
    //     uint256 stakingIDsLength = _stakers.length;

    //     uint256[] memory stakingIDsArray = new uint256[](stakingIDsLength);

    //     for (uint256 i; i < stakingIDsLength; i++) {
    //         StakeInfo storage userStakingInfo = stakeInfo[i];
    //         if (userStakingInfo.isStaked == true) {
    //             if (i != 0) {
    //                 stakingIDsArray[i] = i;
    //             }
    //         }
    //     }

    //     return stakingIDsArray;
    // }

    // function activeStakersList() external view returns (address[] memory) {
    //     address[] memory stakers = _stakers;
    //     uint256 totalStakers = stakers.length;
    //     address[] memory activeStakersArray = new address[](totalStakers);
    //     uint256 activeStakersLength;

    //     for (uint256 i; i < totalStakers; i++) {
    //         if (_isAddressInList(activeStakersArray, stakers[i]) == true) {
    //             continue;
    //         }

    //         if (isStaked(stakers[i])) {
    //             activeStakersArray[activeStakersLength] = stakers[i];
    //             activeStakersLength++;
    //         }
    //     }

    //     return activeStakersArray;
    // }

    function allStakersList()
        external
        view
        returns (uint256 stakersCount, address[] memory stakersList)
    {
        stakersList = _stakers;
        stakersCount = stakersList.length;
    }

    function getTotalValueStaked()
        external
        view
        returns (uint256 token, uint256 anusd)
    {
        token = _totalValueStakedInToken;
        anusd = _totalValueStakedInANUSD;
    }

    function getTotalStakingRewardDistributed()
        external
        view
        returns (uint256 _tokenRewards, uint256 _ansudRewards)
    {
        _tokenRewards = _rewardsDistributedInToken;
        _ansudRewards = _rewardsDistributedInANUSD;
    }

    function getStakingCappings()
        external
        view
        returns (
            uint256 minStakingValue,
            uint256 stakingRewardRate,
            uint256 stakingDuration,
            uint256 stakingRewardClaimTimeLimit
        )
    {
        minStakingValue = _minStakingValue;
        stakingRewardRate = _stakingRewardRate;
        stakingDuration = _stakingDuration;
        stakingRewardClaimTimeLimit = _stakingRewardClaimTimeLimit;
    }

    function setMinStakingValue(
        uint256 _value
    ) external onlyOwner returns (uint256) {
        _minStakingValue = _value;
        return _minStakingValue;
    }

    function setStakingRewardRate(uint256 _valueInPer) external onlyOwner {
        _stakingRewardRate = _valueInPer;
    }

    function setStakingDuration(uint256 _valueInDays) external onlyOwner {
        _stakingDuration = _valueInDays * 1 days;
    }

    function getStakingRewardClaimTimeLimit() external view returns (uint256) {
        return _stakingRewardClaimTimeLimit;
    }

    function setStakingRewardClaimTimeLimity(
        uint256 _valueInDays
    ) external onlyOwner {
        _stakingRewardClaimTimeLimit = _valueInDays * 1 days;
    }

    function _isAddressInList(
        address[] memory _addressList,
        address _addressToSearch
    ) private pure returns (bool) {
        for (uint256 i; i < _addressList.length; i++) {
            if (_addressList[i] == _addressToSearch) {
                return true;
            }
        }

        return false;
    }

    // function _token_usd_out_value(
    //     uint256 _tokenValueIn,
    //     address _tokenContract,
    //     address _usdContract
    // ) private view returns (uint256) {
    //     address[] memory tokenArray = new address[](2);
    //     tokenArray[0] = _tokenContract;
    //     tokenArray[1] = _usdContract;

    //     IVariables variables = IVariables(_variablesContract);

    //     uint256[] memory amounts = IUniswapRouter(
    //         variables.uniswapV2RouterContract()
    //     ).getAmountsOut(_tokenValueIn, tokenArray);

    //     return amounts[1];
    // }

    function getStakingReleaseRewardRate() external view returns (uint8) {
        return _stakingReleaseRewardRate;
    }

    function setStakingReleaseRewardRate(
        uint8 _valueInDecimals
    ) external onlyOwner {
        _stakingReleaseRewardRate = _valueInDecimals;
    }

    function deleteAccount(address _userAddress) external onlyOwner {
        delete account[_userAddress];
    }

    function withdrawTokens(
        address _tokenAddress,
        address _receiver,
        uint256 _value
    ) external onlyOwner returns (bool) {
        IERC20Upgradeable(_tokenAddress).transfer(_receiver, _value);
        return true;
    }

    function withdrawNativeFunds(
        address _receiver,
        uint256 _value
    ) external onlyOwner returns (bool) {
        payable(_receiver).transfer(_value);
        return true;
    }

    function pause() public onlyOwner {
        _pause();
    }

    function unpause() public onlyOwner {
        _unpause();
    }

    function _authorizeUpgrade(
        address newImplementation
    ) internal override onlyOwner {}

    function _getCurrentTime() private view returns (uint256 currentTime) {
        currentTime = block.timestamp;
        return currentTime;
    }

    function _min(uint256 a, uint256 b) private pure returns (uint256) {
        return a < b ? a : b;
    }
}

contracts/StakingV2Upgradeable.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "@openzeppelin/contracts-upgradeable/token/ERC20/IERC20Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/security/PausableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";

interface IERC20_EXTENDED {
    function name() external view returns (string memory);

    function symbol() external view returns (string memory);

    function decimals() external view returns (uint);
}

interface IReferral {
    function payReferralETHAdmin(
        uint256 _value,
        address _userAddress,
        address _referrerAddress
    ) external returns (bool);

    function payStakingReferralAdmin(
        uint256 _value,
        address _referee
    ) external returns (bool);

    function payStakingReferralInUSDTAdmin(
        uint256 _value,
        address _referee
    ) external returns (bool);
}

interface IVariables {
    function presaleContract() external view returns (address);

    function referralContract() external view returns (address);

    function stakingContract() external view returns (address);

    function tokenContract() external view returns (address);

    function anusdContract() external view returns (address);

    function usdtContract() external view returns (address);

    function uniswapV2RouterContract() external view returns (address);

    function tokenContractOwner() external view returns (address);

    function rewardContract() external view returns (address);

    function rewardContractOwner() external view returns (address);

    function adminFees() external view returns (uint256);
}

interface IUniswapRouter {
    function swapExactTokensForTokens(
        uint amountIn,
        uint amountOutMin,
        address[] calldata path,
        address to,
        uint deadline
    ) external returns (uint[] memory);

    function quote(
        uint amountA,
        uint reserveA,
        uint reserveB
    ) external pure returns (uint amountB);

    function getAmountOut(
        uint amountIn,
        uint reserveIn,
        uint reserveOut
    ) external pure returns (uint amountOut);

    function getAmountIn(
        uint amountOut,
        uint reserveIn,
        uint reserveOut
    ) external pure returns (uint amountIn);

    function getAmountsOut(
        uint amountIn,
        address[] calldata path
    ) external view returns (uint[] memory amounts);

    function getAmountsIn(
        uint amountOut,
        address[] calldata path
    ) external view returns (uint[] memory amounts);
}

contract StakingV2Upgradeable is
    Initializable,
    PausableUpgradeable,
    OwnableUpgradeable,
    UUPSUpgradeable
{
    address private _variablesContract;
    address[] private _stakers;
    uint256 private _totalValueStakedInToken;
    uint256 private _totalValueStakedInANUSD;
    uint256 private _totalPrincipalClaimed;
    uint256 private _rewardsDistributedInToken;
    uint256 private _rewardsDistributedInANUSD;

    uint256 private _minStakingValue;

    uint256 private _stakingRewardRate;
    uint256 private _stakingDuration;
    uint256 private _stakingRewardClaimTimeLimit;

    struct Account {
        uint256[] stakingID;
        bool isDisabled;
    }

    struct StakeInfo {
        bool isStaked;
        address owner;
        uint256 valueInToken;
        uint256 valueInANUSD;
        uint256 rewardRate;
        uint256 startTime;
        uint256 duration;
        uint256 rewardClaimedToken;
        uint256 rewardClaimedANUSD;
        uint256 principalClaimed;
        uint256 lastTimeRewardClaimed;
    }

    mapping(address => Account) private account;
    mapping(uint256 => StakeInfo) private stakeInfo;

    event Stake(
        address indexed userAddress,
        uint256 indexed valueStaked,
        uint256 indexed duration,
        uint256 stakingID
    );
    event StakingRewardClaimed(
        address indexed userAddress,
        uint256 indexed reward,
        uint256 indexed stakingID,
        address tokenAddress
    );

    event PrincipalClaimed(address indexed userAddress, uint256 amount);
    event Unstake(
        address indexed userAddress,
        uint256 indexed valueStaked,
        uint256 indexed stakingID
    );

    uint8 private _stakingReleaseRewardRate;

    function initialize() public initializer {
        _variablesContract = 0x77daaFc7411C911b869C71bf70FE36cCE507845d;
        // _minStakingValue = 10000000000000000000;
        _stakingRewardRate = 180;
        _stakingDuration = 760 days;
        _stakingRewardClaimTimeLimit = 30 days;

        __Pausable_init();
        __Ownable_init();
        __UUPSUpgradeable_init();
    }

    receive() external payable {}

    function stakeInfoMap(
        uint256 _stakingID
    ) external view returns (StakeInfo memory) {
        return stakeInfo[_stakingID];
    }

    function _userAccountMap(
        address _userAddress
    ) private view returns (Account memory) {
        return account[_userAddress];
    }

    function userAccountMap(
        address _userAddress
    ) external view returns (Account memory) {
        return account[_userAddress];
    }

    function _buyFromUniswap(
        address _tokenInContract,
        uint256 _tokenInAmount,
        address _tokenOutContract,
        address _uniswapV2Router
    ) private returns (uint256[] memory) {
        address[] memory tokensContracts = new address[](2);
        tokensContracts[0] = _tokenInContract;
        tokensContracts[1] = _tokenOutContract;

        IERC20Upgradeable(_tokenInContract).approve(
            _uniswapV2Router,
            _tokenInAmount
        );

        uint[] memory amounts = IUniswapRouter(_uniswapV2Router)
            .swapExactTokensForTokens(
                _tokenInAmount,
                1,
                tokensContracts,
                address(this),
                block.timestamp + 100
            );

        return amounts;
    }

    function _stake(
        address _address,
        uint256 _valueInToken,
        uint256 _valueInANUSD,
        uint256 _rewardRate,
        uint256 _duration
    ) private returns (bool) {
        _stakers.push(_address);

        uint256 stakingID = _stakers.length;
        uint256 currentTime = block.timestamp;

        Account storage userAccount = account[_address];
        StakeInfo storage userStakingInfo = stakeInfo[stakingID];

        userAccount.stakingID.push(stakingID);

        userStakingInfo.isStaked = true;
        userStakingInfo.owner = _address;
        userStakingInfo.startTime = currentTime;
        userStakingInfo.duration = _duration;
        userStakingInfo.valueInToken = _valueInToken;
        userStakingInfo.valueInANUSD = _valueInANUSD;
        userStakingInfo.rewardRate = _rewardRate;
        userStakingInfo.lastTimeRewardClaimed = currentTime;

        _totalValueStakedInToken += _valueInToken;
        _totalValueStakedInANUSD += _valueInANUSD;

        emit Stake(_address, _valueInToken, _duration, stakingID);
        emit Stake(_address, _valueInANUSD, _duration, stakingID);

        return true;
    }

    function stakeByAdmin(
        address _userAddress,
        uint256 _valueInToken,
        uint256 _valueInANUSD
    ) external {
        address _msgSender = msg.sender;
        IVariables variables = IVariables(_variablesContract);
        require(
            _msgSender == owner() || _msgSender == variables.presaleContract(),
            "Only owner can call this function."
        );

        _stake(
            _userAddress,
            _valueInToken,
            (_valueInANUSD * _stakingRewardRate) / 100,
            _stakingRewardRate,
            _stakingDuration
        );
    }

    // function stakeTopUpByAdmin(
    //     address _userAddress,
    //     uint256 _valueInToken
    // ) external {
    //     address _msgSender = msg.sender;
    //     IVariables variables = IVariables(_variablesContract);
    //     require(
    //         _msgSender == owner() || _msgSender == variables.presaleContract(),
    //         "Only owner can call this function."
    //     );

    //     _stake(_userAddress, _valueInToken, 0, 0, _stakingDuration);
    // }

    function _getStakingRewardANUSD(
        uint256 _stakingID
    ) private view returns (uint256 stakingReward) {
        uint256 currentTime = block.timestamp;
        StakeInfo storage userStakingInfo = stakeInfo[_stakingID];
        uint256 stakingTimePassed = currentTime - userStakingInfo.startTime;
        stakingReward =
            (userStakingInfo.valueInANUSD / userStakingInfo.duration) *
            _min(stakingTimePassed, userStakingInfo.duration) -
            userStakingInfo.rewardClaimedANUSD;
    }

    //in above line rewardClaimedToken is mistakely updated with rewardClaimedANUSD

    function _getStakingRewardsToken(
        uint256 _stakingID
    ) private view returns (uint256 stakingReward) {
        uint256 currentTime = block.timestamp;
        StakeInfo storage userStakingInfo = stakeInfo[_stakingID];
        uint256 stakingTimePassed = currentTime - userStakingInfo.startTime;

        uint256 baseReward = userStakingInfo.valueInToken /
            userStakingInfo.duration;

        stakingReward =
            baseReward *
            _min(stakingTimePassed, userStakingInfo.duration) -
            userStakingInfo.principalClaimed;
    }

    function getStakingReward(
        uint256 _stakingID
    ) external view returns (uint256) {
        return _getStakingRewardANUSD(_stakingID);
    }

    function getUserAllStakingsRewards(
        address _userAddress
    ) external view returns (uint256) {
        uint256[] memory userStakingIDs = account[_userAddress].stakingID;
        uint256 stakingIDLength = userStakingIDs.length;
        uint256 userAllStakingRewards;

        for (uint8 i; i < stakingIDLength; i++) {
            if (stakeInfo[userStakingIDs[i]].isStaked == true) {
                userAllStakingRewards += _getStakingRewardANUSD(
                    userStakingIDs[i]
                );
            }
        }

        return userAllStakingRewards;
    }

    function claimStakingReward(uint256 _stakingID) external whenNotPaused {
        uint256 stakingRewardInANUSD = _getStakingRewardANUSD(_stakingID);
        require(stakingRewardInANUSD > 0, "You have no staking or ended.");
        uint256 principalAmount = stakingRewardInANUSD / 2;

        IVariables variables = IVariables(_variablesContract);

        address _msgSender = msg.sender;
        StakeInfo storage userStakingInfo = stakeInfo[_stakingID];
        Account storage userAccount = account[_msgSender];
        uint256 _currentTime = block.timestamp;

        require(
            userStakingInfo.owner == _msgSender,
            "Sorry staking id doen't belongs to you."
        );

        require(
            !userAccount.isDisabled,
            "Your account is disabled. Please contact admin."
        );

        require(
            userStakingInfo.lastTimeRewardClaimed +
                _stakingRewardClaimTimeLimit <
                block.timestamp,
            "You cannot claim reward before timelimit."
        );

        uint256[] memory rewardClaimed = _buyFromUniswap(
            variables.anusdContract(),
            stakingRewardInANUSD,
            variables.tokenContract(),
            variables.uniswapV2RouterContract()
        );

        userStakingInfo.principalClaimed += principalAmount;
        _totalPrincipalClaimed += principalAmount;

        userStakingInfo.rewardClaimedToken += rewardClaimed[1];
        userStakingInfo.rewardClaimedANUSD += rewardClaimed[0];
        userStakingInfo.lastTimeRewardClaimed = _currentTime;

        _rewardsDistributedInToken += rewardClaimed[1];
        _rewardsDistributedInANUSD += rewardClaimed[0];

        IERC20Upgradeable(variables.tokenContract()).transfer(
            _msgSender,
            rewardClaimed[1]
        );

        emit PrincipalClaimed(_msgSender, principalAmount);
        emit StakingRewardClaimed(
            _msgSender,
            rewardClaimed[1],
            _stakingID,
            variables.tokenContract()
        );
    }

    function isStaked(address _userAddress) public view returns (bool) {
        Account storage userAccount = account[_userAddress];
        uint256[] memory userStakingIDs = userAccount.stakingID;
        uint256 userStakingIDsLength = userStakingIDs.length;

        for (uint256 i; i < userStakingIDsLength; i++) {
            if (stakeInfo[userStakingIDs[i]].isStaked) {
                return true;
            }
        }

        return false;
    }

    function getUserTotalValueStaked(
        address _userAddress
    ) external view returns (uint256 token, uint256 anusd) {
        Account storage userAccount = account[_userAddress];
        uint256[] memory userStakingIDs = userAccount.stakingID;
        uint256 userStakingIDsLength = userStakingIDs.length;

        for (uint256 i; i < userStakingIDsLength; i++) {
            StakeInfo storage userStakeInfo = stakeInfo[userStakingIDs[i]];
            if (userStakeInfo.isStaked) {
                token += userStakeInfo.valueInToken;
                anusd += userStakeInfo.valueInANUSD;
            }
        }
    }

    function getUserStakingIDs(
        address _userAddress
    ) public view returns (uint256[] memory) {
        return account[_userAddress].stakingID;
    }

    function getUserTotalRewardClaimedToken(
        address _userAddress
    ) external view returns (uint256 totalRewardClaim) {
        Account storage userAccount = account[_userAddress];
        uint256[] memory userStakingIDs = userAccount.stakingID;
        uint256 userStakingIDsLength = userStakingIDs.length;

        for (uint256 i; i < userStakingIDsLength; i++) {
            StakeInfo storage userStakeInfo = stakeInfo[userStakingIDs[i]];
            totalRewardClaim += userStakeInfo.rewardClaimedToken;
        }
    }

    function getUserTotalRewardClaimedANUSD(
        address _userAddress
    ) external view returns (uint256 totalRewardClaim) {
        Account storage userAccount = account[_userAddress];
        uint256[] memory userStakingIDs = userAccount.stakingID;
        uint256 userStakingIDsLength = userStakingIDs.length;

        for (uint256 i; i < userStakingIDsLength; i++) {
            StakeInfo storage userStakeInfo = stakeInfo[userStakingIDs[i]];
            totalRewardClaim += userStakeInfo.rewardClaimedANUSD;
        }
    }

    function getUserTotalPrincipalClaimed(
        address _userAddress
    ) external view returns (uint256) {
        Account storage userAccount = account[_userAddress];
        uint256[] memory userStakingIDs = userAccount.stakingID;
        uint256 userStakingIDsLength = userStakingIDs.length;
        uint256 principalAmount;

        for (uint256 i; i < userStakingIDsLength; i++) {
            StakeInfo storage userStakeInfo = stakeInfo[userStakingIDs[i]];
            principalAmount += userStakeInfo.principalClaimed;
        }

        return principalAmount;
    }

    function getStakingTimeRemaining(
        uint256 _stakingID
    ) external view returns (uint256) {
        uint256 _currentTime = block.timestamp;
        StakeInfo storage userStakingInfo = stakeInfo[_stakingID];
        uint256 endTime = userStakingInfo.startTime + userStakingInfo.duration;
        if (_currentTime < endTime) {
            return
                userStakingInfo.startTime +
                userStakingInfo.duration -
                _currentTime;
        }

        return 0;
    }

    function getStakingRewardClaimTimeRemaining(
        uint256 _stakingID
    ) external view returns (uint256) {
        uint256 _currentTime = block.timestamp;
        StakeInfo storage userStakingInfo = stakeInfo[_stakingID];

        if (userStakingInfo.lastTimeRewardClaimed > 0) {
            return
                userStakingInfo.lastTimeRewardClaimed +
                    _stakingRewardClaimTimeLimit <
                    _currentTime
                    ? 0
                    : (userStakingInfo.lastTimeRewardClaimed +
                        _stakingRewardClaimTimeLimit) - _currentTime;
        }

        return
            userStakingInfo.startTime + _stakingRewardClaimTimeLimit <
                _currentTime
                ? 0
                : (userStakingInfo.lastTimeRewardClaimed +
                    _stakingRewardClaimTimeLimit) - _currentTime;
    }

    function isAccountDisabled(
        address _userAddress
    ) public view returns (bool) {
        Account storage userAccount = account[_userAddress];
        return userAccount.isDisabled;
    }

    function getDisabledAccountsList()
        external
        view
        returns (address[] memory)
    {
        address userAddress;
        Account storage userAccount = account[userAddress];
        address[] memory stakers = _stakers;
        uint256 totalStakers = stakers.length;
        address[] memory disabledAddressArray = new address[](totalStakers);
        uint256 disabledStakersLength;

        for (uint256 i; i < totalStakers; i++) {
            userAddress = stakers[i];
            if (_isAddressInList(disabledAddressArray, userAddress) == true) {
                continue;
            }

            if (userAccount.isDisabled == true) {
                disabledAddressArray[disabledStakersLength] = userAddress;
                disabledStakersLength++;
            }
        }

        return disabledAddressArray;
    }

    function disableAccounts(
        address[] calldata _userAddress
    ) external onlyOwner {
        address userAddress;
        Account storage userAccount = account[userAddress];
        uint256 userAddressLength = _userAddress.length;

        for (uint256 i; i < userAddressLength; i++) {
            userAddress = _userAddress[i];
            userAccount.isDisabled = true;
        }
    }

    function enableAccounts(
        address[] calldata _userAddress
    ) external onlyOwner {
        address userAddress;
        Account storage userAccount = account[userAddress];
        uint256 userAddressLength = _userAddress.length;

        for (uint256 i; i < userAddressLength; i++) {
            userAddress = _userAddress[i];
            userAccount.isDisabled = false;
        }
    }

